import React from 'react';

function Profile() {
  return (
    <div>
      <div className='image-container'>
        <img src="" alt="my-pic" />
      </div>
      <div className='paragraph-container'>
        <h1>你好！ <span></span></h1>
        <h1>我是张钰晟，或你也可以叫我 Anson~
        </h1>
        <span>前端资讯工程师</span>
        <p>毕业于台湾中正大学财务金融学系，第一份工作开始于普华永道上海，于大学便开始修习及自学程式设计，熟悉HTML/CSS(scss)/JavaScript，理解React框架及工作原理，并掌握Hooks，Router，状态管理工具redux(redux-toolkit)等相关技术。
        </p>
      </div>
    </div>
  );
}

export default Profile;
